    const [selected, setSelected] = useState("Bam");

    function handleChange(event) {
        setSelected(event.target.value);
    }

    return (
        <FormControl>
            <InputLabel htmlFor="agent-simple">Zgjedhni </InputLabel>
            <Select
                value={selected}
                onChange={handleChange}
                inputProps={{
                    name: "agent",
                    id: "age-simple"
                }}
            >
                {values.map((value, index) => {
                    return <MenuItem value={value}>{value}</MenuItem>;
                })}
            </Select>
        </FormControl>
    );
}
const ProductRow = props => {
    const {product} = props
    return (
        <div className={'product-row'}>
            <div className={'product-row-name'}>{product.title}</div>
            <div className={'product-row-price'}>{product.price}</div>
        </div>
    )
}

const CheckoutView = props => {
    const {items} = props
    return (
        <div className = 'checkout-root'>
            <div className={'checkout-top'}>
                {items.map(item => <ProductRow product={item}/>)}
            </div>

            <div className={'checkout-bottom'}>

            </div>
        </div>
    )
}
export default CheckoutView
